import React from 'react';
import {Col, Button, FormGroup, FormControl, ControlLabel } from "react-bootstrap";
import "./style2.css"
import logo from './login4.png'; 

// 구글로 로그인하지 않고 서버에 직접 회원 등록하는 경우 폼
const SignupForm = ({username, password, email, phone, handleChangeUsername, handleChangePassword, handleChangeEmail, handleChangePhone, handleSubmit, validate}) => {
    return (
      <div className="Signup wrapper fadeInDown">
        <div id="formContent">

          <Col xs={12} className="fadeIn">
            <img src={logo} id="usericon" alt="User Icon" />
          </Col>

        <form methode="POST" onSubmit={handleSubmit}>
        <input type="text" id="username" className="fadeIn" name="login" placeholder="Username" 
              autoFocus
              value={username}
              onChange={handleChangeUsername}
              />
        <input type="email" id="email" className="fadeIn" name="login" placeholder="Email"  
              autoFocus
              value={email}
              onChange={handleChangeEmail}
              />
        <input type="password" id="password" className="fadeIn" name="login" placeholder="Password" value={password}
              onChange={handleChangePassword}
              />
        <input type="phone" id="phone_num" className="fadeIn" name="login" placeholder="Phone Number" autoFocus
              value={phone}
              onChange={handleChangePhone}/>
        <input type="submit" id="submit" className="fadeIn" value="회원가입" disabled={!validate(username, password)}/>



        </form>
        </div>
      </div>
    );
  }

export default SignupForm;
